css:
.diff-view-component {
  height: 100%;
  padding-bottom: 31px;
}
.diff-view-component .title {
  width: 100%;
  text-align: center;
}
.diff-view-component .title p {
  color: #93a1a1;
  font-size: larger;
  margin: 5px;
}
.diff-view-component .split-pane {
  width: 50%;
  height: 100%;
  float: left;
}
atom-text-editor .diff-view-insert .region,
atom-text-editor::shadow .diff-view-insert .region {
  background-color: #17ca65;
}
atom-text-editor .diff-view-delete .region,
atom-text-editor::shadow .diff-view-delete .region {
  background-color: #cc0000;
}
atom-text-editor .gutter .line-number.diff-view-insert .icon-right,
atom-text-editor::shadow .gutter .line-number.diff-view-insert .icon-right {
  visibility: visible;
}
atom-text-editor .gutter .line-number.diff-view-insert .icon-right:before,
atom-text-editor::shadow .gutter .line-number.diff-view-insert .icon-right:before {
  color: #17ca65;
  content: "\f052";
  font-size: 1.1em;
}
atom-text-editor .gutter .line-number.diff-view-delete .icon-right,
atom-text-editor::shadow .gutter .line-number.diff-view-delete .icon-right {
  visibility: visible;
}
atom-text-editor .gutter .line-number.diff-view-delete .icon-right:before,
atom-text-editor::shadow .gutter .line-number.diff-view-delete .icon-right:before {
  color: #cc0000;
  content: "\f052";
  font-size: 1.1em;
}
